import React from "react";
import ReactDOM from "react-dom";
import video from './assets/video_bg.mp4';
import "./index.css";
import App from "./App";
import { BrowserRouter } from 'react-router-dom';

ReactDOM.render(
  <BrowserRouter>
  <video loop autoplay muted id='video_bg'>
    <source src={require('../src/assets/video_bg.mp4')} type ="video/mp4" />
  </video>
    <App />
  </BrowserRouter>,
  document.getElementById("root")
);
